jQuery.extend(jQuery.fn.dataTableExt.oSort,{"stringMonthYear-pre":function(r){var e=["Jan","Feb","Mar","Apr","May","Jun","Jul","Aug","Sep","Oct","Nov","Dec"],t=r.split(" ");t[0]=t[0].replace(",",""),t[1]=jQuery.trim(t[1]);for(var r=t[1],n=0,a=0;a<e.length;a++)if(e[a].toLowerCase()==t[0].toLowerCase().substring(0,3)){n=a;break}return new Date(r,n,1)},"stringMonthYear-asc":function(r,e){return r<e?-1:e<r?1:0},"stringMonthYear-desc":function(r,e){return r<e?1:e<r?-1:0}});